import React from 'react'
import { Link, animateScroll as scroll } from 'react-scroll';

const Header = () => {
    return (
        <>
            <div className="headerContainer">
                <div className="linksContainer">
                    <Link
                        to="home"
                        spy={true}
                        smooth={true}
                        duration={500}
                    >
                        Home
                    </Link>
                    <Link
                        to="home"
                        spy={true}
                        smooth={true}
                        duration={500}
                    >
                        About
                    </Link>
                    <Link
                        to="home"
                        spy={true}
                        smooth={true}
                        duration={500}
                    >
                        Projects
                    </Link>
                    <Link
                        to="home"
                        spy={true}
                        smooth={true}
                        duration={500}
                    >
                        Contact
                    </Link>
                </div>
            </div>
        </>
    )
}

export default Header
